#### Complexity

Runs in `O(1)`, performs no allocations.

#### Examples

```
use willow_data_model::prelude::*;
let empty_component = OwnedComponent::<3>::new_empty();
assert_eq!(empty_component.as_ref(), &[]);
assert_eq!(empty_component, OwnedComponent::<3>::default());
```

298.docs:
Returns an empty [`Path`], i.e., a [`Path`] of zero [`Component`]s.

#### Complexity

Runs in `O(1)`.

#### Examples

```
use willow_data_model::prelude::*;
assert_eq!(Path::<4, 4, 4>::new().component_count(), 0);
assert_eq!(Path::<4, 4, 4>::new(), Path::<4, 4, 4>::default());
```

323.docs:
Creates an iterator over [owned handles](OwnedComponent) to the components of `&self`.

Stepping the iterator takes `O(1)` time and performs no memory allocations.

#### Complexity

Runs in `O(1)`, performs no allocations.

#### Examples

```
use willow_data_model::prelude::*;
let p: Path<4, 4, 4> = Path::from_slices(&[b"hi", b"ho"])?;
let mut comps = p.owned_components();
assert_eq!(comps.next(), Some(OwnedComponent::new(b"hi")?));
assert_eq!(comps.next(), Some(OwnedComponent::new(b"ho")?));
assert_eq!(comps.next(), None);
# Ok::<(), PathError>(())
```

927.docs:
Returns whether `self` and `other` describe equal coordinates, i.e., whether their [subspace ids](Keylike::wdm_subspace_id), [paths](Keylike::wdm_path), and [timestamps](Coordinatelike::wdm_timestamp) are all equal.

# Examples

```
use willow_data_model::prelude::*;

assert!(
    ([7; 32], Path::<4, 4, 4>::new(), 25.into())
    .wdm_coordinate_eq(&([7; 32], Path::<4, 4, 4>::new(), 25.into()))
);
assert!(
    !([7; 32], Path::<4, 4, 4>::new(), 25.into())
    .wdm_coordinate_eq(&([8; 32], Path::<4, 4, 4>::new(), 25.into()))
);
```

650.docs:
Returns whether `self` is an [open range](https://willowprotocol.org/specs/grouping-entries/index.html#open_range).

```
use willow_data_model::prelude::*;

assert_eq!(WillowRange::<u8>::from(3..8).is_open(), false);
assert_eq!(WillowRange::<u8>::from(3..255).is_open(), false);
assert_eq!(WillowRange::<u8>::from(3..=255).is_open(), true);
assert_eq!(WillowRange::<u8>::from(3..).is_open(), true);
```

373.docs:
Creates the greatest possible [`Path`] (with respect to lexicographical ordering, which is also the [`Ord`] implementation of [`Path`]).

#### Complexity

Runs in `O(MCC + MPL)`. Performs a single allocation of `O(MPL)` bytes.

#### Examples

```
use willow_data_model::prelude::*;
use order_theory::GreatestElement;

let p = Path::<4, 4, 4>::greatest();
assert_eq!(p.component_count(), 4);
assert_eq!(p.component(0).unwrap().as_ref(), &[255, 255, 255, 255]);
assert!(p.component(1).unwrap().is_empty());
assert!(p.component(2).unwrap().is_empty());
assert!(p.component(3).unwrap().is_empty());
```

121.docs:
Creates an [`OwnedComponent`] by copying data from a byte slice. Returns [`None`] if the slice is longer than `MCL`.

#### Complexity

Runs in `O(n)`, where `n` is the length of the slice. Performs a single allocation of `O(n)` bytes.

#### Examples

```
use willow_data_model::prelude::*;
assert!(OwnedComponent::<3>::new(b"yay").is_ok());
assert!(OwnedComponent::<3>::new(b"too_long").is_err());
```

