Returns the `Range3d` which [includes](Grouping::wdm_includes) every [coordinate](Coordinatelike).

```
use willow_data_model::prelude::*;

let r = Range3d::<2, 2, 2, u8>::full();

assert!(r.wdm_includes(&(6, Path::new(), Timestamp::from(9))));
