317.docs:
Returns the `i`-th [`Component`] of `&self`, without checking whether `i < self.component_count()`.

#### Safety

Undefined behaviour if `i >= self.component_count()`.

#### Complexity

Runs in `O(1)`, performs no allocations.

#### Examples

```
use willow_data_model::prelude::*;
let p: Path<4, 4, 4> = Path::from_slices(&[b"hi", b"ho"])?;
assert_eq!(unsafe { p.component_unchecked(0) }, Component::new(b"hi")?);
assert_eq!(unsafe { p.component_unchecked(1) }, Component::new(b"ho")?);
# Ok::<(), PathError>(())
```

644.docs:
Returns the [intersection](https://willowprotocol.org/specs/grouping-entries/index.html#range_intersection) of `self` and `other`, i.e., the [`WillowRange`] which [includes](core::ops::RangeBounds::contains) exactly those values [included](core::ops::RangeBounds::contains) in both `self` and `other`.

If you want to check whether some value is [included](core::ops::RangeBounds::contains) in the intersecion of two ranges, prefer [`WillowRange::does_intersection_include_value`] over explicitly constructing the intersection.

```
use willow_data_model::prelude::*;

assert_eq!(WillowRange::<u8>::from(4..9).intersection(&(5..7)), (5..7).into());
assert_eq!(WillowRange::<u8>::from(4..9).intersection(&(5..11)), (5..9).into());
assert_eq!(WillowRange::<u8>::from(4..9).intersection(&(2..7)), (4..7).into());
assert!(WillowRange::<u8>::from(4..9).intersection(&(11..14)).is_empty());
assert!(WillowRange::<u8>::from(4..9).intersection(&(6..6)).is_empty());
```

921.docs:
Returns whether `self` and `other` describe non-equal keys, i.e., whether their [subspace ids](Keylike::wdm_subspace_id) and [paths](Keylike::wdm_path) are not both equal.

# Examples

```
use willow_data_model::prelude::*;

assert!(!("alfie", Path::<4, 4, 4>::new()).wdm_key_ne(&("alfie", Path::<4, 4, 4>::new())));
assert!(("alfie", Path::<4, 4, 4>::new()).wdm_key_ne(&("betty", Path::<4, 4, 4>::new())));
```

744.docs:
Returns the [`Range3d`] which [includes](Grouping::wdm_includes) `coord` but no other value.

```
use willow_data_model::prelude::*;

let r = Range3d::<2, 2, 2, u8>::singleton(&(6, Path::new(), Timestamp::from(9)));

assert!(r.wdm_includes(&(6, Path::new(), Timestamp::from(9))));
assert!(!r.wdm_includes(&(16, Path::new(), Timestamp::from(9))));
```

869.docs:
Returns the [intersection](https://willowprotocol.org/specs/grouping-entries/#aoi_intersection) of `self` and `other`.

```
use willow_data_model::prelude::*;

let aoi1 = AreaOfInterest::new(
    Area::<2, 2, 2, u8>::new(None, Path::new(), ..Timestamp::from(17)),
    5,
    400,
);
let aoi2 = AreaOfInterest::new(
    Area::<2, 2, 2, u8>::new(None, Path::new(), Timestamp::from(14)..),
    12,
    32,
);

assert_eq!(
    aoi1.intersection(&aoi2),
    AreaOfInterest::new(
        Area::<2, 2, 2, u8>::new(
            None,
            Path::new(),
            Timestamp::from(14)..Timestamp::from(17),
        ),
        5,
        32,
    ),
);
```

13.docs:
Turns this builder into an immutable [`Path`].

Panics if the number of [`Component`]s or the total length does not match what was claimed in [`PathBuilder::new`].

#### Complexity

Runs in `O(1)` time. Performs no allocations.

#### Examples

```
use willow_data_model::prelude::*;
let mut builder = PathBuilder::<4, 4, 4>::new(4, 2)?;
builder.append_component(Component::new(b"hi")?);
builder.append_slice(b"ho")?;
assert_eq!(builder.build(), Path::from_slices(&[b"hi", b"ho"])?);
# Ok::<(), PathError>(())
```

315.docs:
Returns the [`Ordering`] describing the prefix relation between `self` and `other`.

#### Complexity

Runs in `O(n + m)`, where `n` is the total length of the longer [`Path`] in bytes, and `m` is the greatest number of [`Component`]s.

#### Examples

```
use core::cmp::Ordering;
use willow_data_model::prelude::*;
let p: Path<4, 4, 4> = Path::from_slice(b"hi")?;
assert_eq!(p.prefix_cmp(&Path::new()), Some(Ordering::Greater));
assert_eq!(p.prefix_cmp(&Path::from_slice(b"hi")?), Some(Ordering::Equal));
assert_eq!(p.prefix_cmp(&Path::from_slices(&[b"hi", b"ho"])?), Some(Ordering::Less));
assert_eq!(p.prefix_cmp(&Path::from_slice(b"no")?), None);
# Ok::<(), PathError>(())
```

11.docs:
Appends the data for the next [`Component`], from a slice of bytes.

#### Complexity

Runs in `O(component_length)` time. Performs no allocations.

#### Examples

```
use willow_data_model::prelude::*;
let mut builder = PathBuilder::<4, 4, 4>::new(4, 2)?;
builder.append_slice(b"hi")?;
builder.append_slice(b"ho")?;
assert_eq!(builder.build(), Path::from_slices(&[b"hi", b"ho"])?);
# Ok::<(), PathError>(())
```

313.docs:
Tests whether `&self` is [prefixed by](https://willowprotocol.org/specs/data-model/index.html#path_prefix) the given [`Path`].
[`Path`]s are always prefixed by themselves, and by the empty [`Path`].

#### Complexity

Runs in `O(n + m)`, where `n` is the total length of the longer [`Path`] in bytes, and `m` is the greatest number of [`Component`]s.

#### Examples

```
use willow_data_model::prelude::*;
let p: Path<4, 4, 4> = Path::from_slices(&[b"hi", b"ho"])?;
assert!(p.is_prefixed_by(&Path::new()));
assert!(p.is_prefixed_by(&Path::from_slice(b"hi")?));
assert!(p.is_prefixed_by(&Path::from_slices(&[b"hi", b"ho"])?));
assert!(!p.is_prefixed_by(&Path::from_slices(&[b"hi", b"gh"])?));
# Ok::<(), PathError>(())
```

463.docs:
Compares `self` to another entry by [timestamp](https://willowprotocol.org/specs/data-model/index.html#entry_timestamp), [payload_digest](https://willowprotocol.org/specs/data-model/index.html#entry_payload_digest) (in case of a tie), and [payload_length](https://willowprotocol.org/specs/data-model/index.html#entry_payload_length) third (in case of yet another tie). See also [`EntrylikeExt::wdm_is_newer_than`] and [`EntrylikeExt::wdm_is_older_than`].

Comparing recency is primarily important to determine [which entries overwrite each other](https://willowprotocol.org/specs/data-model/index.html#prefix_pruning); the [`EntrylikeExt::wdm_prunes`] method checks for that directly.

# Examples

```
use core::cmp::Ordering;
use willow_data_model::prelude::*;

let entry = Entry::builder()
    .namespace_id("family")
    .subspace_id("alfie")
    .path(Path::<4, 4, 4>::new())
    .timestamp(12345)
    .payload_digest("b")
    .payload_length(17)
    .build().unwrap();

assert_eq!(entry.wdm_cmp_recency(&entry), Ordering::Equal);

let lesser_timestamp = Entry::prefilled_builder(&entry).timestamp(5).build().unwrap();
assert_eq!(entry.wdm_cmp_recency(&lesser_timestamp), Ordering::Greater);

let lesser_digest = Entry::prefilled_builder(&entry).payload_digest("a").build().unwrap();
assert_eq!(entry.wdm_cmp_recency(&lesser_digest), Ordering::Greater);

let lesser_length = Entry::prefilled_builder(&entry).payload_length(0).build().unwrap();
assert_eq!(entry.wdm_cmp_recency(&lesser_length), Ordering::Greater);

let greater_timestamp = Entry::prefilled_builder(&entry).timestamp(999999).build().unwrap();
assert_eq!(entry.wdm_cmp_recency(&greater_timestamp), Ordering::Less);

let greater_digest = Entry::prefilled_builder(&entry).payload_digest("c").build().unwrap();
assert_eq!(entry.wdm_cmp_recency(&greater_digest), Ordering::Less);

let greater_length = Entry::prefilled_builder(&entry).payload_length(99).build().unwrap();
assert_eq!(entry.wdm_cmp_recency(&greater_length), Ordering::Less);
```

[Spec definition](https://willowprotocol.org/specs/data-model/index.html#entry_newer).

9.docs:
Creates a builder for a [`Path`] of known total length and component count, efficiently prefilled with the first `prefix_component_count` [`Component`]s of a given `reference` [`Path`]. Panics if there are not enough [`Component`]s in the `reference`.

The missing component data must be filled in before building.

#### Complexity

Runs in `O(target_total_length + target_component_count)`, performs a single allocation of `O(total_length + component_count)` bytes.

```
use willow_data_model::prelude::*;
let p = Path::<4, 4, 4>::from_slices(&[b"hi", b"he"])?;
let mut builder = PathBuilder::new_from_prefix(4, 2, &p, 1)?;
builder.append_component(Component::new(b"ho")?);
assert_eq!(builder.build(), Path::from_slices(&[b"hi", b"ho"])?);
# Ok::<(), PathError>(())
```

311.docs:
Returns the sum of the lengths of the first `i` [`Component`]s in `&self`; panics if `i >= self.component_count()`. More efficient than `path.create_prefix(i).path_length()`.

Guaranteed to be at most `MCC`.

#### Complexity

Runs in `O(1)`, performs no allocations.

#### Examples

```
use willow_data_model::prelude::*;
let p: Path<4, 4, 4> = Path::from_slices(&[b"hi", b"ho"])?;
assert_eq!(p.total_length_of_prefix(0), 0);
assert_eq!(p.total_length_of_prefix(1), 2);
assert_eq!(p.total_length_of_prefix(2), 4);
# Ok::<(), PathError>(())
```

663.docs:
Returns the `WillowRange` which [includes](core::ops::RangeBounds::contains) every value of type `T`.

```
use willow_data_model::prelude::*;

assert_eq!(WillowRange::<u8>::full(), (..).into());
```

738.docs:
Returns a reference to the inner [`TimeRange`](super::TimeRange).

```
use willow_data_model::prelude::*;

let r = Range3d::<2, 2, 2, u8>::new(5..=8, .., ..Timestamp::from(17));
assert_eq!(r.times(), &WillowRange::from(..Timestamp::from(17)));
