use willow_data_model::prelude::*;

let aoi = AreaOfInterest::new(
    Area::<2, 2, 2, u8>::new(None, Path::new(), ..Timestamp::from(17)),
    5,
    400,
);
assert_eq!(aoi.max_size(), 400);
```

[Definition](https://willowprotocol.org/specs/grouping-entries/#AreaPath).

