let a = Area::<2, 2, 2, u8>::new(Some(17), Path::new(), ..Timestamp::from(17));

assert!(a.admits_pruning_by(&(17, Path::new(), Timestamp::from(9))));
assert!(!a.admits_pruning_by(&(18, Path::new(), Timestamp::from(9))));
