# Ok::<(), PathError>(())
```

641.docs:
Returns whether every possible item that is [included](core::ops::RangeBounds::contains) in `other` is also [included](core::ops::RangeBounds::contains) in `self`.

If `other` is a [`WillowRange`], you can equivalently check `self >= other`.

```
use willow_data_model::prelude::*;

assert_eq!(WillowRange::<u8>::from(4..9).includes_range(&(5..7)), true);
assert_eq!(WillowRange::<u8>::from(4..9).includes_range(&(5..11)), false);
assert_eq!(WillowRange::<u8>::from(4..9).includes_range(&(2..7)), false);
assert_eq!(WillowRange::<u8>::from(4..9).includes_range(&(4..9)), true);
```

464.docs:
Returns whether this entry would be [prefix pruned](https://willowprotocol.org/specs/data-model/index.html#prefix_pruning) by another entry.

Prefix pruning powers deletion in Willow: whenever a data store would contain two entries, one of which pruens the other, the other is removed from the data store (or never inserted in the first place). Informally speaking, newer entries remove older entries, but only if they are in the same namespace and subspace, and only if the path of the newer entry is a prefix of the path of the older entry.

More precisely: an entry `e1` prunes an entry `e2` if and only if

- `e1.namespace_id() == e2.namespace_id()`,
- `e1.subspace_id() == e2.subspace_id()`,
- `e1.path().is_prefix_of(e2.path())`, and
- `e1.wdm_is_newer_than(&e2)`.

This method is the reciprocal of [`EntrylikeExt::wdm_prunes`].

# Examples


```
use willow_data_model::prelude::*;

let entry = Entry::builder()
    .namespace_id("family")
    .subspace_id("alfie")
    .path(Path::<4, 4, 4>::from_slices(&[b"a", b"b"])?)
    .timestamp(12345)
    .payload_digest("b")
    .payload_length(17)
    .build().unwrap();

let newer = Entry::prefilled_builder(&entry).timestamp(99999).build().unwrap();
assert!(entry.wdm_is_pruned_by(&newer));
assert!(!newer.wdm_is_pruned_by(&entry));

let newer_and_prefix = Entry::prefilled_builder(&newer)
    .path(Path::<4, 4, 4>::from_slices(&[b"a"])?).build().unwrap();
assert!(entry.wdm_is_pruned_by(&newer_and_prefix));
assert!(!newer_and_prefix.wdm_is_pruned_by(&entry));

let newer_and_extension = Entry::prefilled_builder(&newer)
    .path(Path::<4, 4, 4>::from_slices(&[b"a", b"b", b"c"])?).build().unwrap();
assert!(!entry.wdm_is_pruned_by(&newer_and_extension));
assert!(!newer_and_extension.wdm_is_pruned_by(&entry));

let newer_but_unrelated_namespace = Entry::prefilled_builder(&newer)
    .namespace_id("bookclub").build().unwrap();
assert!(!entry.wdm_is_pruned_by(&newer_but_unrelated_namespace));
assert!(!newer_but_unrelated_namespace.wdm_is_pruned_by(&entry));

let newer_but_unrelated_subspace = Entry::prefilled_builder(&newer)
    .subspace_id("betty").build().unwrap();
assert!(!entry.wdm_is_pruned_by(&newer_but_unrelated_subspace));
assert!(!newer_but_unrelated_subspace.wdm_is_pruned_by(&entry));
# Ok::<(), PathError>(())
```

10.docs:
Appends the data for the next [`Component`].

#### Complexity

Runs in `O(component_length)` time. Performs no allocations.

#### Examples

```
use willow_data_model::prelude::*;
let mut builder = PathBuilder::<4, 4, 4>::new(4, 2)?;
builder.append_component(Component::new(b"hi")?);
builder.append_component(Component::new(b"ho")?);
assert_eq!(builder.build(), Path::from_slices(&[b"hi", b"ho"])?);
# Ok::<(), PathError>(())
```

312.docs:
Tests whether `&self` is a [prefix](https://willowprotocol.org/specs/data-model/index.html#path_prefix) of the given [`Path`].
[`Path`]s are always a prefix of themselves, and the empty [`Path`] is a prefix of every [`Path`].

#### Complexity

Runs in `O(n + m)`, where `n` is the total length of the longer [`Path`] in bytes, and `m` is the greatest number of [`Component`]s.

#### Examples

```
use willow_data_model::prelude::*;
let p: Path<4, 4, 4> = Path::from_slices(&[b"hi", b"ho"])?;
assert!(Path::new().is_prefix_of(&p));
assert!(Path::from_slice(b"hi")?.is_prefix_of(&p));
assert!(Path::from_slices(&[b"hi", b"ho"])?.is_prefix_of(&p));
assert!(!Path::from_slices(&[b"hi", b"gh"])?.is_prefix_of(&p));
# Ok::<(), PathError>(())
```

639.docs:
A continuous subset of a type implementing [`Ord`].

It is either a [closed range](https://willowprotocol.org/specs/grouping-entries/index.html#closed_range) consisting of an inclusive start value and an exclusive end value, or an [open range](https://willowprotocol.org/specs/grouping-entries/index.html#open_range) consisting only of an inclusive start value.

```
use std::ops::RangeBounds;
use willow_data_model::prelude::*;

assert!(WillowRange::<u8>::from(4..9).contains(&6));
assert!(!WillowRange::<u8>::from(4..9).contains(&12));

// You can create `WillowRanges` from arbitrary Rust ranges.
assert!(WillowRange::<u8>::from(4..=8) == WillowRange::<u8>::from(4..9));
```

