306.docs:
Creates a new [`Path`] by appending another [`Path`] to `&self`.

Creates a fully separate copy of the new data on the heap; which includes cloning all data in `&self` and in `&other`.

#### Complexity

Runs in `O(n + m)`, where `n` is the total length of the resulting [`Path`] in bytes, and `m` is the number of its [`Component`]s. Performs a single allocation of `O(n + m)` bytes.

#### Examples

```
use willow_data_model::prelude::*;
let p0: Path<4, 4, 4> = Path::new();
let p1 = p0.append_path(&Path::from_slices(&[b"hi", b"ho"])?)?;
assert_eq!(
    p1.append_path(&Path::from_slice(b"no!")?),
    Err(PathFromComponentsError::PathTooLong),
);
# Ok::<(), PathError>(())
```

733.docs:
An [`Area`](https://willowprotocol.org/specs/grouping-entries/#Area) is a box in three-dimensional willow space, consisting of all entries matching either a single subspace id or entries of arbitrary subspace ids, prefixed by some [`Path`], and a [`TimeRange`](super::TimeRange).

Areas are the default way by which application developers should aggregate entries. See [the specification](https://willowprotocol.org/specs/grouping-entries/#areas) for more details.

```
use willow_data_model::prelude::*;

let a1 = Area::<2, 2, 2, u8>::new(None, Path::new(), ..Timestamp::from(17));

assert!(a1.wdm_includes(&(6, Path::new(), Timestamp::from(9))));
assert_eq!(a1.subspace(), None);

let a2 = Area::<2, 2, 2, u8>::new(Some(42), Path::new(), Timestamp::from(15)..);
assert_eq!(
    a1.wdm_intersection(&a2),
    Area::<2, 2, 2, u8>::new(
        Some(42),
        Path::new(),
        Timestamp::from(15)..Timestamp::from(17),
    ),
);
```

[Specification](https://willowprotocol.org/specs/grouping-entries/#Area)

304.docs:
Creates a new [`Path`] by appending a slice of [`Component`]s to `&self`.

Creates a fully separate copy of the new data on the heap; which includes cloning all data in `&self`. To efficiently construct [`Path`]s, use [`Path::from_components`], [`Path::from_slices`], [`Path::from_components_iter`], [`Path::from_slices_iter`], or a [`PathBuilder`].

#### Complexity

Runs in `O(n + m)`, where `n` is the total length of the resulting [`Path`] in bytes, and `m` is the number of its [`Component`]s. Performs a single allocation of `O(n + m)` bytes.

#### Examples

```
use willow_data_model::prelude::*;
let p0: Path<4, 4, 4> = Path::new();
let p1 = p0.append_components(&[Component::new(b"hi")?, Component::new(b"!")?])?;
assert_eq!(
    p1.append_components(&[Component::new(b"no!")?]),
    Err(PathFromComponentsError::PathTooLong),
);
# Ok::<(), PathError>(())
```

404.docs:
Creates a builder which is prefilled with the data from some other entry.

Use this function to create modified copies of entries.

# Examples

```
use willow_data_model::prelude::*;

// Supplying all necessary data yields an entry.
let first_entry = Entry::builder()
    .namespace_id("family")
    .subspace_id("alfie")
    .path(Path::<4, 4, 4>::new())
    .timestamp(12345)
    .payload_digest("some_hash")
    .payload_length(17)
    .build().unwrap();

assert_eq!(*first_entry.wdm_payload_digest(), "some_hash");

let second_entry = Entry::prefilled_builder(&first_entry)
    .timestamp(67890)
    .payload_digest("another_hash")
    .payload_length(4)
    .build().unwrap();

assert_eq!(*second_entry.wdm_payload_digest(), "another_hash");
```

454.docs:
Functionality around Willow [Entries](https://willowprotocol.org/specs/data-model/index.html#Entry).

Entries are the metadata by which payload strings are identified in Willow  see the [`Entry`] struct for more information.

Applications can construct concrete entries via [`EntryBuilders`](EntryBuilder). Code which merely needs to inspect entries should make use of the [`Entrylike`] trait, however. This trait describes exactly which information an entry provides, and lets code abstract over any *specific* representation (such as the [`Entry`] struct) of entries.

```
use willow_data_model::prelude::*;

let entry = Entry::builder()
    .namespace_id("family")
    .subspace_id("alfie")
    .path(Path::<4, 4, 4>::new())
    .timestamp(12345)
    .payload_digest("some_hash")
    .payload_length(17)
    .build().unwrap();

assert_eq!(*entry.wdm_subspace_id(), "alfie");

